insert into SHOW (ShowID, Name, Description, Capacity) values (1, 'Big Cat Keeper', 'Talk with an animal keeper who cares for the Zoos lions and tigers twice daily between the animal yards to the right of the carousel in Great Cats Circle.', 867);
insert into SHOW (ShowID, Name, Description, Capacity) values (2, 'Highlights Tour', 'Overview of the Zoo. 2 hour walking tour subject to volunteer availability. Groups larger than 10 people please call 202-633-3056.', 16);
insert into SHOW (ShowID, Name, Description, Capacity) values (3, 'Fish Feeding', '', 77);
insert into SHOW (ShowID, Name, Description, Capacity) values (4, 'Meet-a-Small Mammal', 'An animal keeper will introduce you to one of the Zoo''s small mammals like an armadillo or naked mole-rat.', 83);
insert into SHOW (ShowID, Name, Description, Capacity) values (5, 'Amazon Fish Feeding', 'Thousands of fish species live in the Amazon River Basin. Meet some of them during this feeding in Amazonia.', 570);
insert into SHOW (ShowID, Name, Description, Capacity) values (6, 'Andean Bear Keeper Chat', 'Talk with one of the animal keepers who cares for the Zoo''s Andean bears daily at 11 a.m. and 2 p.m. Andean bears are located between the Zoo''s Amazonia and American Trail exhibits.', 438);
insert into SHOW (ShowID, Name, Description, Capacity) values (7, 'Bird Banding Demonstration', 'Engage with a Smithsonian Migratory Bird Center scientist as they demonstrate how they band and study wild birds. This demo will take place on Wednesdays in front of the Zoo’s Amazonia exhibit.
insert into SHOW (ShowID, Name, Description, Capacity) values (8, 'Elephant Keeper Talk', 'Learn all about Asian elephants and how animal care staff work with these four-ton animals!', 91);
insert into SHOW (ShowID, Name, Description, Capacity) values (9, 'Kids Farm Keeper Talk', 'Alpacas, donkeys, and goats-Oh My! Keepers will introduce you to one of the many furry or feathered residents of the Farm. This demonstration is weather dependent.', 37);
insert into SHOW (ShowID, Name, Description, Capacity) values (10, 'Meet-a-Reptile or Amphibian', 'Come meet a keeper at the Reptile Discovery Center and learn about one fascinating species they care for.', 40);
insert into SHOW (ShowID, Name, Description, Capacity) values (11, 'Red Panda or Giant Panda Keeper Talk', 'Come hear what it takes to look after the Zoos pandas from one of our animal keepers. This demonstration may take place at the red panda OR giant panda yards. Check the board at the entrance to Asia Trail for the exact location.', 50);
insert into SHOW (ShowID, Name, Description, Capacity) values (12, 'Seal or Sea Lion Demo', 'Watch as keeper staff train our seals or sea lions and learn more about these beautiful marine mammals!', 70);
insert into SHOW (ShowID, Name, Description, Capacity) values (13, 'Gorilla Keeper Talk', 'Learn about the fascinating world of apes. Look for an animal keeper outside by the gorilla yard or inside the Great Ape house to hear about our gorilla troops..', 90);
insert into SHOW (ShowID, Name, Description, Capacity) values (14, 'Meet-a-Zoo Nutritionist', 'Meet a Zoo Nutritionist and find out what it takes to feed and care for Zoo animals from Ants to Elephants.', 13);
insert into SHOW (ShowID, Name, Description, Capacity) values (15, 'Bird Keeper Chat', 'By 2021, the Zoo’s historic 1928 Bird House and the surrounding bird plateau will transform into Experience Migration, a first-of-its-kind attraction with almost 100 species of migratory birds integral to North, Central and South American ecosystems.
insert into SHOW (ShowID, Name, Description, Capacity) values (16, 'Lion Training', 'This exciting experience puts you face-to-face with African lions. Watch how the keepers care for the lions during this narrated presentation. Predator Zone features a training area where zookeepers and visitors are on the same level as the animals. See behind-the-scenes training that the keepers conduct on a daily basis to care for the Zoo’s lions.', 80);
insert into SHOW (ShowID, Name, Description, Capacity) values (17, 'Komodo Dragon Feedings', '', 5);
insert into SHOW (ShowID, Name, Description, Capacity) values (18, 'Snake Feedings', '', 25);
insert into SHOW (ShowID, Name, Description, Capacity) values (19, 'Kiwanis Giraffe Encounter', 'Cost, $3.50 plus tax', 101);
insert into SHOW (ShowID, Name, Description, Capacity) values (20, 'Protective Life Carousel Rides', 'Take a spin on the Zoo’s animal-themed carousel. There are an array of animals to choose from – a giraffe, rhinoceros, gorilla, ', 74);
insert into SHOW (ShowID, Name, Description, Capacity) values (21, 'Bird Interaction', 'Interact with some feathered friends.  ', 76);
insert into SHOW (ShowID, Name, Description, Capacity) values (22, 'Amazing Animal Ambassadors', 'Come see our Amazing Animal Ambassadors as they show off their skills and talents to impress the judges, the audience!  Iguanas, snakes, goats, and birds are just some of the competitors you will see.', 19);
insert into SHOW (ShowID, Name, Description, Capacity) values (23, 'Wings of Wonder', 'Take flight with our Wings of Wonder (WOW) bird show! This powerful natural behavior bird show will bring you closer to our winged-friends and ignite the wondrous world of flight right in front of you and over you. The stars of the show are many and change daily with each show.', 59);
insert into SHOW (ShowID, Name, Description, Capacity) values (24, 'Sea Lion Splash', 'Our six sea lions will delight you with their playful antics each day! Join us for an educational and interactive show experience that will leave you cheering.', 61);
insert into SHOW (ShowID, Name, Description, Capacity) values (25, 'Meet the Keepers Series', 'Throughout the day, you are invited to selected animal exhibits to "Meet the Keeper." Through these informal programs you''ll learn about the animals in the wild.You''ll also learn how animals are cared for outside the wild and how keepers safely care for dangerous carnivores. Keepers also show how they care for both the animals physical and mental well-being through behavioral enrichment programs.You will discover how accredited zoos support the conservation of species for future generations both in and outside the wild.', 31);
